function Card({blog}){
    return (
        <div className="border flex justify-center  max-w-[1000px] p-4 m-4 flex-col">
            <h1 className="font-bold text-2xl">{blog.title}</h1>
            <p>{blog.body}</p>
        </div>
    )
}

export default Card
